The functionality of the mana module should be implemented in a mana package. Then, a mana plugin can use the package structs and methods to connect the dots, for example execute BookMana when TransactionConfirmed event is triggered in the value tangle. BaseMana is a struct that holds the different mana values for a given node. Note that except for Base Mana 1 calculation, we need the time when BaseMana values were updated, so we store it in the struct: type BaseMana struct { BaseMana1 float EffectiveBaseMana1 float BaseMana2 float EffectiveBaseMana2 float LastUpdated time
} BaseManaVector is a data structure that maps nodeIDs to BaseMana. It also has a Type that denotes the type of mana this vector deals with (Access, Consensus, etc.). type BaseManaVector struct { vector map[identity.ID]*BaseMana vectorType Type
} Methods BaseManaVector should have the following methods: BookMana(transaction): Book mana of a transaction. Trigger ManaBooked event. Note, that this method updates BaseMana with respect to time and to new Base Mana 1 and Base Mana 2 values. GetWeightedMana(nodeID, weight) mana: Return weight * Effective Base Mana 1 + (1-weight)+Effective Base Mana 2. weight is a number in [0,1] interval. Notice, that weight = 1 results in only returning Effective Base Mana 1, and the other way around. Note, that this method also updates BaseMana of the node with respect to time. GetMana(nodeID) mana: Return 0.5*Effective Base Mana 1 + 0.5*Effective Base Mana 2 of a particular node. Note, that this method also updates BaseMana of the node with respect to time. update(nodeID, time): update Base Mana 2, Effective Base Mana 1 and Effective Base Mana 2 of a node with respect time. updateAll(time): update Base Mana 2, Effective Base Mana 1 and Effective Base Mana 2 of all nodes with respect to time. BaseMana should have the following methods: pledgeAndUpdate(transaction): update BaseMana fields and pledge mana with respect to transaction. revokeBaseMana1(amount, time): update BaseMana values with respect to time and revoke amount BaseMana1. update(time): update all BaseMana fields with respect to time. updateEBM1(time): update Effective Base Mana 1 wrt to time. updateBM2(time): update Base Mana 2 wrt to time. updateEBM2(time): update Effective Base Mana 2 wrt to time. Base Mana Calculation There are two cases when the values within Base Mana Vector are updated: A confirmed transaction pledges mana. Any module accesses the Base Mana Vector, and hence its values are updated with respect to access time. First, let's explore the former. A confirmed transaction pledges mana For simplicity, we only describe mana calculation for one of the Base Mana Vectors, namely, the Base Access Mana Vector. First, a TransactionConfirmed event is triggered, therefore BaseManaVector.BookMana(transaction) is executed: func (bmv *BaseManaVector) BookMana(tx *transaction) { pledgedNodeID := tx.accessMana for input := range tx.inputs { // search for the nodeID that the input's tx pledged its mana to inputNodeID := loadPledgedNodeIDFromInput(input) // save it for proper event trigger oldMana := bmv[inputNodeID] // revoke BM1 bmv[inputNodeID].revokeBaseMana1(input.balance, tx.timestamp) // trigger events Events.ManaRevoked.Trigger(&ManaRevokedEvent{inputNodeID, input.balance, tx.timestamp, AccessManaType}) Events.ManaUpdated.Tigger(&ManaUpdatedEvent{inputNodeID, oldMana, bmv[inputNodeID], AccessManaType}) } // save it for proper event trigger oldMana := bmv[pledgedNodeID] // actually pledge and update bm1Pledged, bm2Pledged := bmv[pledgedNodeID].pledgeAndUpdate(tx) // trigger events Events.ManaPledged.Trigger(&ManaPledgedEvent{pledgedNodeID, bm1Pledged, bm2Pledged, tx.timestamp, AccessManaType}) Events.ManaUpdated.Trigger(&ManaUpdatedEvent{pledgedNodeID, oldMana, bmv[pledgedNodeID], AccessManaType})
} Base Mana 1 is being revoked from the nodes that pledged mana for inputs that the current transaction consumes. Then, the appropriate node is located in Base Mana Vector, and mana is pledged to its BaseMana. Events are essential to study what happens within the module from the outside. Note, that revokeBaseMana1 accesses the mana entry of the nodes within Base Mana Vector, therefore all values are updated with respect to t. Notice the two branches after the condition. When Base Mana values had been updated before the transaction's timestamp, a regular update is carried out. However, if t is older, than the transaction timestamp, an update in the "past" is carried out and values are updated up to LastUpdated. func (bm *BaseMana) revokeBaseMana1(amount float64, t time.Time) { if t.After(bm.LastUpdated) { // regular update n := t.Sub(bm.LastUpdated) // first, update EBM1, BM2 and EBM2 until `t` bm.updateEBM1(n) bm.updateBM2(n) bm.updateEBM2(n) bm.LastUpdated = t // revoke BM1 at `t` bm.BaseMana1 -= amount } else { // update in past n := bm.LastUpdated.Sub(t) // revoke BM1 at `t` bm.BaseMana1 -= amount // update EBM1 to `bm.LastUpdated` bm.EffectiveBaseMana1 -= amount*(1-math.Pow(math.E,-EMA_coeff_1*n)) }
} The same regular and past update scheme is applied to pledging mana too: func (bm *BaseMana) pledgeAndUpdate(tx *transaction) (bm1Pledged int, bm2Pledged int){ t := tx.timestamp bm1Pledged = sum_balance(tx.inputs) if t.After(bm.LastUpdated) { // regular update n := t.Sub(bm.LastUpdated) // first, update EBM1, BM2 and EBM2 until `t` bm.updateEBM1(n) bm.updateBM2(n) bm.updateEBM2(n) bm.LastUpdated = t bm.BaseMana1 += bm1Pledged // pending mana awarded, need to see how long funds sat for input := range tx.inputs { // search for the timestamp of the UTXO that generated the input t_inp := LoadTxTimestampFromOutputID(input) bm2Add := input.balance * (1 - math.Pow(math.E, -decay*(t-t_inp))) bm.BaseMana2 += bm2Add bm2Pledged += bm2Add } } else { // past update n := bm.LastUpdated.Sub(t) // update BM1 and BM2 at `t` bm.BaseMana1 += bm1Pledged oldMana2 = bm.BaseMana2 for input := range tx.inputs { // search for the timestamp of the UTXO that generated the input t_inp := LoadTxTimestampFromOutputID(input) bm2Add := input.balance * (1-math.Pow( math.E,-decay*(t-t_inp) ) ) * math.Pow(math.E, -decay*n) bm.BaseMana2 += bm2Add bm2Pledged += bm2Add } // update EBM1 and EBM2 to `bm.LastUpdated` bm.EffectiveBaseMana1 += amount*(1-math.Pow(math.E,-EMA_coeff_1*n)) if EMA_coeff_2 != decay { bm.EffectiveBaseMana2 += (bm.BaseMana2 - oldMana2) *EMA_coeff_2*(math.Pow(math.E,-decay*n)- math.Pow(math.E,-EMA_coeff_2*n))/(EMA_coeff_2-decay) / math.Pow(math.E, -decay*n) } else { bm.EffectiveBaseMana2 += (bm.BaseMana2 - oldMana2) * decay * n }
} return bm1Pledged, bm2Pledged
} Notice, that in case of EMA_coeff_2 = decay, a simplified formula can be used to calculate EffectiveBaseMana2. The same approach is applied in updateEBM2(). func (bm *BaseMana) updateEBM1(n time.Duration) { bm.EffectiveBaseMana1 = math.Pow(math.E, -EMA_coeff_1 * n) * bm.EffectiveBaseMana1 + (1-math.Pow(math.E, -EMA_coeff_1 * n)) * bm.BaseMana1
} func (bm *BaseMana) updateBM2(n time.Duration) { bm.BaseMana2 = bm.BaseMana2 * math.Pow(math.E, -decay*n)
} func (bm *BaseMana) updateEBM2(n time.Duration) { if EMA_coeff_2 != decay { bm.EffectiveBaseMana2 = math.Pow(math.E, -emaCoeff2 * n) * bm.EffectiveBaseMana2 + (math.Pow(math.E, -decay * n) - math.Pow(math.E, -EMA_coeff_2 * n)) / (EMA_coeff_2 - decay) * EMA_coeff_2 / math.Pow(math.E, -decay * n)*bm.BaseMana2 } else { bm.EffectiveBaseMana2 = math.Pow(math.E, -decay * n)*bm.EffectiveBaseMana2 + decay * n * bm.BaseMana2 }
} Any module accesses the Base Mana Vector In this case, the accessed entries within Base Mana Vector are updated via the method: func (bmv *BaseManaVector) update(nodeID ID, t time.Time ) { oldMana := bmv[nodeID] bmv[nodeID].update(t) Events.ManaUpdated.Trigger(&ManaUpdatedEvent{nodeID, oldMana, bmv[nodeID], AccessManaType})
} where t is the access time. func (bm *BaseMana) update(t time.Time ) { n := t - bm.LastUpdated bm.updateEBM1(n) bm.updateBM2(n) bm.updateEBM2(n) bm.LastUpdated = t
} Events The mana package should have the following events: Pledged when mana (BM1 and BM2) was pledged for a node due to new transactions being confirmed. type PledgedEvent struct { NodeID []bytes AmountBM1 int AmountBM2 int Time time.Time Type ManaType // access or consensus
} Revoked when mana (BM1) was revoked from a node. type RevokedEvent struct { NodeID []bytes AmountBM1 int Time time.Time Type ManaType // access or consensus
} Updated when mana was updated for a node due to it being accessed. type UpdatedEvent struct { NodeID []bytes OldMana BaseMana NewMana BaseMana Type ManaType // access or consensus
} Testing Write unit tests for all methods. Test all events and if they are correctly triggered. Benchmark calculations in tests to see how heavy it is to calculate EMAs and decays.

