The FPC protocol requires nodes to directly query randomly selected nodes for conflict resolution. However, the information produced during such a voting mechanism is not stored in the Tangle, rather only lives within the node's local metadata. This can be a problem for nodes joining the network at a later stage, specifically when a conflict is considered marked as level of knowledge 3 by the majority of the network, a new node cannot query it anymore. Moreover, since the quorum to query is randomly formed proportionally to cMana, the highest cMana nodes would need to reply to too many queries, as their probability to be included in the quorum of each node is high. We propose an optimization of the protocol that, in turn, should solve both of the above issues. The idea is to let each node be free to choose whether writing its opinion on a given conflict and a given FPC round on the Tangle. Payload We need to first define the FPC Statement payload: type Statement struct { ConflictsCount uint32 Conflicts Conflicts TimestampsCount uint32 Timestamps Timestamps
}
type Conflict struct { ID transaction.ID Opinion
}
type Timestamp struct { ID tangle.MessageID Opinion
} Registry We also define an Opinion Registry where nodes can store and keep track of the opinions from each node after parsing FPC Statements. type Registry struct { nodesView map[identity.ID]*View
}
type View struct { NodeID identity.ID Conflicts map[transaction.ID]Opinions Timestamps map[tangle.MessageID]Opinions
} Given a nodeID and a ConflictID (or a messageID for timestamps), a node can check if it has the required opinion in its registry, and thus use that during its FPC round, or if not, send a traditional query to the node. Broadcasting an FPC Statement A node, after forming its opinion for 1 or more conflicts during an FPC round, can prepare an FPC statement containing the result of that round and issue it on the Tangle. Currently, any node that belongs to the top 70% cMana issues FPC statements. This parameter is local to the node and can be changed by the node operator.

